import React from 'react';
import { BrowserRouter as Router, Route, Switch, useLocation } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/';
import AboutMe from './components/AboutMe';
import Services from './components/Services';
import Research from './components/Research';
import PatientResources from './components/PatientResources';
import Contact from './components/contact';
import VascularSurgery from './components/VascularSurgery';
import './App.css';

const MainLayout = () => (
  <>
    <Home />
    <AboutMe />
    <Services />
    <Research />
    <PatientResources />
    <Contact />
  </>
);

const App = () => {
  const location = useLocation();
  const isVascularSurgeryPage = location.pathname === '/vascular-surgery';

  return (
    <div className="App">
      <Navbar />
      <Switch>
        <Route path="/" exact component={MainLayout} />
        <Route path="/about" component={MainLayout} />
        <Route path="/services" component={MainLayout} />
        <Route path="/research" component={MainLayout} />
        <Route path="/patient-resources" component={MainLayout} />
        <Route path="/contact" component={MainLayout} />
        <Route path="/vascular-surgery" component={VascularSurgery} />
      </Switch>
    </div>
  );
};

const AppWrapper = () => (
  <Router>
    <App />
  </Router>
);

export default AppWrapper;
